import React from 'react';
const Main = () => {
  const firstName = `Steven`;
  const lastName = `Yoh`
  return (
    <div className="main-home">
      <svg width="1083" height="450" viewBox="0 0 1083 450" fill="none" xmlns="http://www.w3.org/2000/svg">
      <path d="M831.391 43H204V396.913H831.391V43Z" fill="#6C63FF"/>
      <path opacity="0.1" d="M651.968 396.913H204V43L651.968 396.913Z" fill="black"/>
      </svg>
        <p>{firstName}</p>
        <p>{lastName}</p>
    </div>
  )
}

export default Main;
